import Admin from "./pages/Admin";
import Appeals from "./pages/Appeals";
import Contacts from "./pages/Contacts";
import Login from "./pages/Login";
import MainPage from "./pages/MainPage";
import PersonalAccount from "./pages/PersonalAccount";
import Registration from "./pages/Registration";
import Services from "./pages/Services";
import Structure from "./pages/Structure";
import TeamNews from "./pages/TeamNews";
import Vacancies from "./pages/Vacancies";
import { ADMIN_ROUTE, APPEALS_ROUTE, CONTACTS_ROUTE, LOGIN_ROUTE, MAINPAGE_ROUTE, PERSONALACCOUNT_ROUTE, REGISTRATION_ROUTE, SERVICES_ROUTE, STRUCTURE_ROUTE, TEAMNEWS_ROUTE, VACANCIES_ROUTE } from "./utils/consts";

export const authRoutes = [
    {
        path: ADMIN_ROUTE,
        Component: Admin
    },
    {
        path: PERSONALACCOUNT_ROUTE,
        Component: PersonalAccount
    },
]

export const publicRoutes = [
    {
        path: APPEALS_ROUTE,
        Component: Appeals
    },
    {
        path: CONTACTS_ROUTE,
        Component: Contacts
    },
    {
        path: MAINPAGE_ROUTE,
        Component: MainPage
    },
    {
        path: LOGIN_ROUTE,
        Component: Login
    },
    {
        path: REGISTRATION_ROUTE,
        Component: Registration
    },
    {
        path: SERVICES_ROUTE,
        Component: Services
    },
    {
        path: STRUCTURE_ROUTE,
        Component: Structure
    },
    {
        path: TEAMNEWS_ROUTE,
        Component: TeamNews
    },
    {
        path: VACANCIES_ROUTE,
        Component: Vacancies
    },

]
